import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import Card from "../UI/Card";

const useStyles = makeStyles((theme) => {});

const AddUser = () => {
  return (
    <Card className={classes.card}>
      <CardContent>
        <form>
          <TextField
            type="text"
            id="outlined-basic"
            label="Username"
            variant="outlined"
          />
          <TextField
            type="number"
            id="outlined-basic"
            label="Age(Years)"
            variant="outlined"
          />
        </form>
      </CardContent>
    </Card>
  );
};

export default AddUser;
